import { Component } from '@angular/core';

@Component({
  selector: 'app-books',
  templateUrl: './books.component.html',
  styleUrls: ['./books.component.css']
})

export class BooksComponent {
  name: string = 'Lionel Messi';
  position: string = 'Forward, Attacking Midfielder';
  img: string = 'https://www.google.com/url?sa=i&url=https%3A%2F%2Fen.wikipedia.org%2Fwiki%2FLionel_Messi&psig=AOvVaw2HRYQgrQzsVkOXVwPuUAHc&ust=1685729925749000&source=images&cd=vfe&ved=0CBAQjRxqFwoTCNjL0L_Xov8CFQAAAAAdAAAAABAE';
}
